import { useState, useEffect, useTransition, useContext } from "react";
import { Table, TableHead, TableRow, TableCell } from "@mui/material";

import { HEADERS } from "../utils/constants";
import { FilterContext } from "../context/FilterContext";

// import XLFile from "../data/77-Jamnagar-Rural -Data.xlsx";

const UserTable = () => {
	const { result, isFiltered } = useContext(FilterContext);

	return (
		<div>
			<p className="text-center my-2 fw-bold">77 - Jamnagar Rular</p>
			<Table stickyHeader aria-label="sticky table">
				<TableHead>
					<TableRow>
						{HEADERS &&
							HEADERS.map((item, index) => {
								return <TableCell key={index}>{item}</TableCell>;
							})}
					</TableRow>
				</TableHead>
				<tbody>
					{result &&
						result.map((item, index) => {
							return (
								<tr key={index}>
									<td>{item.PART_NAME_EN}</td>
									<td>{item.PSBUILDING_NAME_EN}</td>
									<td>{item.SECTION_NAME_EN}</td>
									<td>{item.FM_NAME_EN}</td>
									<td>{item.LASTNAME_EN}</td>
									<td>{item.RLN_FM_NM_EN}</td>
									<td>{item.RLN_L_NM_EN}</td>
									<td>{item.GENDER}</td>
									<td>{item.AGE}</td>
									<td>{item.PIN_CODE}</td>
								</tr>
							);
						})}
				</tbody>
			</Table>
		</div>
	);
};

export default UserTable;
